{
    "scenario 1": {
        "dialogue": [
            {
                "Doris": "Charlotte, I heard about the job review. I can only imagine how you must be feeling right now.",
                "Charlotte": "It's been tough, Doris. I didn't expect them to be so critical. I feel like I've been doing my best."
            },
            {
                "Doris": "I understand why you'd be upset. It's completely normal to feel this way. Let's talk about it and see if there's anything we can do to improve the situation."
            }
        ]
    },
    "scenario 2": {
        "dialogue": [
            {
                "Doris": "Have you thought about looking for a different path in your career, maybe something that might make you happier?",
                "Charlotte": "I've thought about it, but I'm not sure if I should make a move or how to go about it."
            },
            {
                "Doris": "It's a big decision, and it's okay to explore your options. What aspects of a job are you looking for that you feel are missing now?"
            }
        ]
    },
    "scenario 3": {
        "dialogue": [
            {
                "Doris": "Charlotte, I feel like there might be more you're not sharing about your job situation. It's important to be open so we can figure this out together.",
                "Charlotte": "I guess I'm just scared of admitting that maybe I'm not cut out for this job."
            },
            {
                "Doris": "Thank you for being honest with me. It's okay to have these doubts, and acknowledging them is the first step towards figuring out what you really want."
            }
        ]
    },
    "scenario 4": {
        "dialogue": [
            {
                "Doris": "I'm glad you feel that we can talk about these things openly. I'm here for you, whatever you decide.",
                "Charlotte": "Thank you, Doris. I really appreciate your honesty and support. It helps me a lot."
            },
            {
                "Doris": "It's what friends are for. Let's keep this dialogue open. I believe in you and will support you in any way I can."
            }
        ]
    },
    "scenario 5": {
        "dialogue": [
            {
                "Doris": "To celebrate your new journey, I've organized a little gathering with some of our closest friends. It's a way to celebrate your courage and the steps you're taking.",
                "Charlotte": "That's so thoughtful of you, Doris! I don't know what I would do without your support."
            },
            {
                "Doris": "You deserve it, Charlotte. Here's to new beginnings and to knowing that whatever happens, you have friends who love and support you."
            }
        ]
    }
}

